import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import './App.css';

// Create placeholder components for pages that were deleted
const LandingPage: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Welcome to Questomer</h1>
      <p>Your startup-investor matching platform</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/login" style={{ color: 'white', margin: '10px' }}>Login</a>
        <a href="/register" style={{ color: 'white', margin: '10px' }}>Register</a>
      </div>
    </header>
  </div>
);

const LoginPage: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Login Page</h1>
      <p>Please sign in to your account</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/" style={{ color: 'white', margin: '10px' }}>Back to Home</a>
        <a href="/register" style={{ color: 'white', margin: '10px' }}>Register</a>
      </div>
    </header>
  </div>
);

const RegisterPage: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Register Page</h1>
      <p>Create a new account</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/" style={{ color: 'white', margin: '10px' }}>Back to Home</a>
        <a href="/login" style={{ color: 'white', margin: '10px' }}>Login</a>
      </div>
    </header>
  </div>
);

const StartupDashboard: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Startup Dashboard</h1>
      <p>Your startup dashboard and analytics</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/" style={{ color: 'white', margin: '10px' }}>Back to Home</a>
      </div>
    </header>
  </div>
);

const InvestorDashboard: React.FC = () => (
  <div className="App">
    <header className="App-header">
      <h1>Investor Dashboard</h1>
      <p>Your investor dashboard and analytics</p>
      <div style={{ marginTop: '20px' }}>
        <a href="/" style={{ color: 'white', margin: '10px' }}>Back to Home</a>
      </div>
    </header>
  </div>
);

// AppProvider placeholder for context
const AppProvider: React.FC<{children: React.ReactNode}> = ({children}) => (
  <>{children}</>
);

// Create a protected route component placeholder
const ProtectedRoute: React.FC<{children: React.ReactNode, userRole: string}> = ({children}) => (
  <>{children}</>
);

function App() {
  return (
    <AppProvider>
      <Router>
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<LandingPage />} />
          <Route path="/login" element={<LoginPage />} />
          <Route path="/register" element={<RegisterPage />} />

          {/* Startup Routes */}
          <Route path="/startup/dashboard" element={
            <ProtectedRoute userRole="startup">
              <StartupDashboard />
            </ProtectedRoute>
          } />

          {/* Investor Routes */}
          <Route path="/investor/dashboard" element={
            <ProtectedRoute userRole="investor">
              <InvestorDashboard />
            </ProtectedRoute>
          } />

          {/* Fallback Route */}
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Router>
    </AppProvider>
  );
}

export default App;
